#[derive(Debug, PartialEq, Eq, Copy, Clone, Default)]
enum Movement {
    #[default]
    Default,
    MistUpgraded,
}

fn has_movement(ctx: &Context, m: Movement, spot: SpotId) -> bool {
    match m {
        Movement::Default => true,
        Movement::MistUpgraded => rules::access_mist_upgraded(ctx),
    }
}

